INSERT INTO `sys_article` (`id`, `artAbstract`, `content`, `publishTime`, `readCount`, `supportCount`, `title`, `unSupportCount`, `category_id`, `publish_org_id`, `publishAuthor_id`, `imgUrl`, `tag`) VALUES
('402881e858aa060a0158aa09af1f0000', '昆药集团股份有限公司公告（系列）', '<p style="margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; color: rgb(0, 0, 0); font-family: &quot;Microsoft YaHei&quot;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;">八届十一次监事会决议公告</p><p style="margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; color: rgb(0, 0, 0); font-family: &quot;Microsoft YaHei&quot;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;">　　本公司董事会及全体董事保证本公告内容不存在任何虚假记载、误导性陈述或者重大遗漏，并对其内容的真实性、准确性和完整性承担个别及连带责任。</p><p style="margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; color: rgb(0, 0, 0); font-family: &quot;Microsoft YaHei&quot;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;">　　昆药集团股份有限公司（以下简称“昆药集团”、“公司”）于2016年11月22日以书面和电子邮件形式向全体监事发出了公司八届十一次监事会议的通知和材料，并于2016年11月24日以电话会议的方式召开。会议由公司姚卫平监事会主席召集并主持，本次会议应参加表决监事5人，实际参加表决5人，符合《公司法》和《公司章程》的规定。会议一致审议通过了以下决议：</p><p style="margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; color: rgb(0, 0, 0); font-family: &quot;Microsoft YaHei&quot;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;">　　1、关于利用闲置自有资金进行保本投资理财业务的预案（详见公司《关于利用闲置自有资金进行保本投资理财业务的公告》）</p><p style="margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; color: rgb(0, 0, 0); font-family: &quot;Microsoft YaHei&quot;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;">　　同意：5票反对：0票弃权：0票</p><p style="margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; color: rgb(0, 0, 0); font-family: &quot;Microsoft YaHei&quot;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;">　　2、关于使用部分闲置募集资金进行现金管理的预案（详见公司《关于使用部分暂时闲置募集资金进行现金管理的公告》）</p><p style="margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; color: rgb(0, 0, 0); font-family: &quot;Microsoft YaHei&quot;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;">　　同意：5票反对：0票弃权：0票</p><p style="margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; color: rgb(0, 0, 0); font-family: &quot;Microsoft YaHei&quot;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;">　　特此公告。</p><p style="margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; color: rgb(0, 0, 0); font-family: &quot;Microsoft YaHei&quot;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;">　　昆药集团股份有限公司监事会</p><p style="margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; color: rgb(0, 0, 0); font-family: &quot;Microsoft YaHei&quot;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;">　　2016年11月28日</p><p style="margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; color: rgb(0, 0, 0); font-family: &quot;Microsoft YaHei&quot;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;">　　证券代码：600422 证券简称：昆药集团公告编号：临2016-100号</p><p><ins class="sinaads sinaads-fail" id="Sina_Plista_AD" data-ad-pdps="PDPS000000059666" data-ad-status="done" style="color: rgb(0, 0, 0); font-family: &quot;Microsoft YaHei&quot;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;"></ins></p><p style="margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; color: rgb(0, 0, 0); font-family: &quot;Microsoft YaHei&quot;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;">　　昆药集团股份有限公司关于昆药集团</p><p style="margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; color: rgb(0, 0, 0); font-family: &quot;Microsoft YaHei&quot;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;">　　医药商业有限公司签订曲靖市</p><p style="margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; color: rgb(0, 0, 0); font-family: &quot;Microsoft YaHei&quot;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;">　　康桥医药有限责任公司股权收购及</p><p style="margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; color: rgb(0, 0, 0); font-family: &quot;Microsoft YaHei&quot;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;">　　增资协议的公告</p><p style="margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; color: rgb(0, 0, 0); font-family: &quot;Microsoft YaHei&quot;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;">　　本公司董事会及全体董事保证本公告内容不存在任何虚假记载、误导性陈述或者重大遗漏，并对其内容的真实性、准确性和完整性承担个别及连带责任。</p><p style="margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; color: rgb(0, 0, 0); font-family: &quot;Microsoft YaHei&quot;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;">　　2016年10月27日公司八届二十一次董事会审议通过了关于公司全资子公司昆药集团医药商业有限公司(以下简称“昆药商业”)收购曲靖市康桥医药有限责任公司(以下简称“曲靖康桥”)60%股权的议案，详见公司于2016年10月28日在《中国证券报》、《上海证券报》、《证券时报》、《证券日报》及上海证券交易所网站www.sse.com.cn披露的临2016-095号《关于昆药集团医药商业有限公司收购曲靖市康桥医药有限责任公司60%股权及对其提供借款的公告》。因收购仅针对曲靖康桥的批发及医院配送业务，目前曲靖康桥资产剥离工作及标的资产的审计评估工作已完成，并于2016年11月25日与标的资产股东签订股权转让及增资协议。本协议签署事项已于2016年11月24日公司八届二十二次董事会审议全票同意通过。交易具体情况如下：</p><p style="margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; color: rgb(0, 0, 0); font-family: &quot;Microsoft YaHei&quot;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;">　　一、交易基本情况</p><p style="margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; color: rgb(0, 0, 0); font-family: &quot;Microsoft YaHei&quot;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;">　　昆药商业拟现金出资2，700万元向曲靖康桥全体股东收购曲靖康桥60%股权，并在收购后持股方共同对曲靖康桥增资，其中昆药商业增资600万元，交易完成后，目标公司注册资本增加至人民币1，120万元，昆药商业持有曲靖康桥60%股权。（注：在临2016-095号公告中，交易完成后，曲靖康桥注册资本1，180万元，因曲靖康桥进行了非标的资产剥离，其注册资本由180万元减少为120万元，增资事宜完成后，注册资本变更为1，120万元）</p><p style="margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; color: rgb(0, 0, 0); font-family: &quot;Microsoft YaHei&quot;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;">　　二、交易对方基本情况</p><p style="margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; color: rgb(0, 0, 0); font-family: &quot;Microsoft YaHei&quot;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;">　　本收购事项的交易对方为曲靖康桥目前的全体股东：</p><p style="margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; color: rgb(0, 0, 0); font-family: &quot;Microsoft YaHei&quot;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;">　　1、蒋建飞，持股比率39%，性别：男，住所：曲靖市潇湘新区2505号、职务：曲靖康桥法定代表人兼总经理；</p><p style="margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; color: rgb(0, 0, 0); font-family: &quot;Microsoft YaHei&quot;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;">　　2、胡强，持股比率26%、性别：男，住所：曲靖市潇湘新区2504号、职务：曲靖康桥副总经理；</p><p style="margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; color: rgb(0, 0, 0); font-family: &quot;Microsoft YaHei&quot;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;">　　3、田建东，持股比率7%；4、陈德仲，持股比率7%；5、徐树升，持股比率7%；6、郭兰芳，持股比率7%；7、韩丽，持股比率7%。</p><p style="margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; color: rgb(0, 0, 0); font-family: &quot;Microsoft YaHei&quot;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;">　　交易对方除其持股的曲靖康桥与昆药商业存在商品购销关系外，与昆药集团不存在其他产权、业务、资产、债权债务、人员等方面的其它关系。</p><p style="margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; color: rgb(0, 0, 0); font-family: &quot;Microsoft YaHei&quot;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;">　　三、交易标的基本情况</p><p style="margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; color: rgb(0, 0, 0); font-family: &quot;Microsoft YaHei&quot;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;">　　公司名称：曲靖市康桥医药有限责任公司</p><p style="margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; color: rgb(0, 0, 0); font-family: &quot;Microsoft YaHei&quot;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;">　　企业性质：有限责任公司</p><p style="margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; color: rgb(0, 0, 0); font-family: &quot;Microsoft YaHei&quot;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;">　　注册地址：云南省曲靖市麒麟南路220号</p><p style="margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; color: rgb(0, 0, 0); font-family: &quot;Microsoft YaHei&quot;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;">　　法定代表人：蒋建飞</p><p style="margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; color: rgb(0, 0, 0); font-family: &quot;Microsoft YaHei&quot;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;">　　注册资本：120万元（因剥离非交易资产，曲靖康桥注册资本由180万元减少为120万元，本减资事项于2016年9月29日完成工商变更登记。）</p><p style="margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; color: rgb(0, 0, 0); font-family: &quot;Microsoft YaHei&quot;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;">　　成立日期： 1998年3月16日</p><p style="margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; color: rgb(0, 0, 0); font-family: &quot;Microsoft YaHei&quot;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;">　　经营范围：中药材，生化药品，中药饮片，抗生素，中成药，生物制品（不含血液制品、不含疫苗），化学药制剂，蛋白同化制剂及肽类激素，医疗器械，保健食品，预包装食品兼散装食品、乳制品（含婴幼儿配方乳粉），眼镜，农副产品、化工原料（不含危险化学品）、五金机械、日用百货，劳保用品，物流设备，化妆品，计生用品，消毒用品，电子产品，办公用品，工艺美术品销售及配送、信息咨询服务；医疗设备租赁。</p><p style="margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; color: rgb(0, 0, 0); font-family: &quot;Microsoft YaHei&quot;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;">　　曲靖康桥于1998年3月设立，现有仓储办公面积4，000多平方米，于2015年2月5日通过国家新版GSP的认证。该公司主营业务为对配送区域内基层及县级以上医疗机构提供药品配送。经根据中审众环会计师事务所（特殊合伙人）出具的文号为[众环审字]（2016）161578号审计报告，截至2015年末，曲靖康桥总资产6，681万元，总负债 6，804万元，净资产-123万元；2015年全年，曲靖康桥实现营业收入9，757万元、净利润11万元。截至2016年10月31日，曲靖康桥总资产7，364万元，总负债 6，988万元，净资产376万元；2016年1-10月，曲靖康桥实现营业收入9，911万元、净利润256万元。</p><p style="margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; color: rgb(0, 0, 0); font-family: &quot;Microsoft YaHei&quot;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;">　　北京亚超资产评估有限公司（以下简称“北京亚超”）对本次昆药商业拟收购的曲靖康桥60%股权在2016年10月31日的市场价值进行了评估，并出具了编号为北京亚超评报字[P2016]A118的评估报告，以2016年10月31日为评估基准日，在曲靖康桥持续经营的前提下，得出如下评估结果：</p><p style="margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; color: rgb(0, 0, 0); font-family: &quot;Microsoft YaHei&quot;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;">　　（一）曲靖康桥股东全部权益采用资产基础法评估结论</p><p style="margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; color: rgb(0, 0, 0); font-family: &quot;Microsoft YaHei&quot;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;">　　曲靖康桥股东全部权益采用资产基础法评估价值结论：408.38万元。净资产账面价值376.08 万元，评估价值408.38 万元，评估价值与账面价值比较，绝对变动额为32.30 万元，相对变动率为8.59 %。</p><p style="margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; color: rgb(0, 0, 0); font-family: &quot;Microsoft YaHei&quot;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;">　　（二）曲靖康桥股东全部权益采用收益法评估结论</p><p style="margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; color: rgb(0, 0, 0); font-family: &quot;Microsoft YaHei&quot;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;">　　曲靖康桥在评估基准日2016年10月31日持续经营的前提下，纳入评估范围的总资产账面值7，364.13 万元，总负债账面值6，988.04 万元，净资产账面值376.08 万元；采用收益法评估的曲靖康桥股东全部权益价值为4，541.29万元，绝对变动额4，165.21万元，相对变动率1107.53%。</p><p style="margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; color: rgb(0, 0, 0); font-family: &quot;Microsoft YaHei&quot;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;">　　（三）评估结果分析</p><p style="margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; color: rgb(0, 0, 0); font-family: &quot;Microsoft YaHei&quot;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;">　　采用资产基础法估算的曲靖康桥股东全部权益价值为408.38万元，采用收益法估算的价值为4，541.29万元，两种方法结果差4，132.91万元，差异率1，012.02%。</p><p style="margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; color: rgb(0, 0, 0); font-family: &quot;Microsoft YaHei&quot;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;">　　1、两种评估方法考虑的角度不同，收益法是从企业的未来获利能力角度考虑的，资产基础法是从资产重新取得途径考虑的。资产基础法主要采用成本法评估，不考虑未来风险对评估结论的影响。收益法是对企业未来的营业收入和营业成本进行合理预测，通过未来净现金流量折现加总得出评估结论。</p><p style="margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; color: rgb(0, 0, 0); font-family: &quot;Microsoft YaHei&quot;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;">　　2、基于本次评估的目的，最终选取收益法得出的评估价值作为最终评估结论。</p><p style="margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; color: rgb(0, 0, 0); font-family: &quot;Microsoft YaHei&quot;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;">　　（四）昆药商业拟收购康桥医药60%股权价值评估结论</p><p style="margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; color: rgb(0, 0, 0); font-family: &quot;Microsoft YaHei&quot;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;">　　根据评估目的，以收益法的评估结论作为康桥医药股东全部权益评估价值，即康桥医药股东全部权益评估价值为4，541.29万元。昆药商业拟收购康桥医药60%股权价值评估结论=4，541.29×60%= 2，724.77万元。</p><p style="margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; color: rgb(0, 0, 0); font-family: &quot;Microsoft YaHei&quot;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;">　　（五）收益法计算依据</p><p style="margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; color: rgb(0, 0, 0); font-family: &quot;Microsoft YaHei&quot;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;">　　本次评估最终选取收益法得出的评估价值作为评估结果，收益法评估计算模型所采用的折现率9.54%，根据<span id="stock_sz000028"><a href="http://finance.sina.com.cn/realstock/company/sz000028/nc.shtml" class="keyword" target="_blank" style="color: rgb(17, 62, 170); text-decoration: none;">国药一致</a></span><span id="quote_sz000028">(<span style="color:black">71.900</span>,&nbsp;<span style="color:black">0.00</span>,&nbsp;<span style="color:black">0.00%</span>)</span>、<span id="stock_sz000411"><a href="http://finance.sina.com.cn/realstock/company/sz000411/nc.shtml" class="keyword" target="_blank" style="color: rgb(17, 62, 170); text-decoration: none;">英特集团</a></span><span id="quote_sz000411">(<span style="color:green">23.290</span>,&nbsp;<span style="color:green">-0.38</span>,&nbsp;<span style="color:green">-1.61%</span>)</span>、<span id="stock_sz000963"><a href="http://finance.sina.com.cn/realstock/company/sz000963/nc.shtml" class="keyword" target="_blank" style="color: rgb(17, 62, 170); text-decoration: none;">华东医药</a></span><span id="quote_sz000963">(<span style="color:green">73.000</span>,&nbsp;<span style="color:green">-1.20</span>,&nbsp;<span style="color:green">-1.62%</span>)</span>、<span id="stock_sh600511"><a href="http://finance.sina.com.cn/realstock/company/sh600511/nc.shtml" class="keyword" target="_blank" style="color: rgb(17, 62, 170); text-decoration: none;">国药股份</a></span><span id="quote_sh600511">(<span style="color:red">31.500</span>,&nbsp;<span style="color:red">0.09</span>,&nbsp;<span style="color:red">0.29%</span>)</span>四家行业同类型企业的市场公开数据计算的债权比例、股权价值比例，以及标的企业曲靖康桥账面数据计算得出；评估计算采用的曲靖康桥预期营业收入增长率6%，依据商务部发布的《2015年药品流通行业运行统计分析报告》显示全国药品流通行业2015年度销售额增长率10.2%，曲靖康桥截止2016年10月31日的审计报告所得出的增长率22%，结合曲靖康桥往期经营数据综合测算得出；估值采用的曲靖康桥预期销售毛利率16%，按照曲靖康桥往期数据批发业务部分计算所得，评估参数选取具备合理性。收益法评估计算表如下（单位：万元）：</p><p style="margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; color: rgb(0, 0, 0); font-family: &quot;Microsoft YaHei&quot;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;">　　■</p><p style="margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; color: rgb(0, 0, 0); font-family: &quot;Microsoft YaHei&quot;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;">　　公司董事会对本次评估相关事宜发表审核意见，认为本次昆药商业拟收购曲靖康桥股权资产由具有证券期货相关业务评估资格的评估机构北京亚超进行了评估。评估机构在评估过程中，充分考虑了本次交易的目的和本次拟收购资产的业务特点和实际经营情况，采用的评估方法适当、评估假设前提合理；评估依据、及关键评估参数采用市场公允数据结合标的企业过往经营情况及对未来发展的合理预估测算所得，具备合理性；评估结果能够客观反映标的资产的公允价值，评估结论合理。</p><p style="margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; color: rgb(0, 0, 0); font-family: &quot;Microsoft YaHei&quot;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;">　　公司独立董事对对本次评估相关事宜发表独立意见，认为昆药商业收购曲靖市康桥医药有限责任公司60%股权事项聘请北京亚超承担此次交易的评估工作，并签署了相关协议，选聘程序合规。北京亚超作为本次拟购买资产的评估机构，具有证券期货业务评估资质的专业评估机构，具备胜任本次评估工作的能力。公司与北京亚超除委托评估业务关系外，无其他关联关系，具有独立性。同时，北京亚超及其评估人员与资产占有方及有关当事人没有现实或将来预期的利害关系，具有独立性。</p><p style="margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; color: rgb(0, 0, 0); font-family: &quot;Microsoft YaHei&quot;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;">　　本资产收购事项不涉及债权债务转移，交易定价以采用收益法评估价值2，724.77万元为上限协商确定，符合市场规律。</p><p style="margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; color: rgb(0, 0, 0); font-family: &quot;Microsoft YaHei&quot;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;">　　四、交易协议的主要内容</p><p style="margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; color: rgb(0, 0, 0); font-family: &quot;Microsoft YaHei&quot;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;">　　截止本公告日，交易协议尚未签署，拟签署的协议主要条款内容如下：</p><p style="margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; color: rgb(0, 0, 0); font-family: &quot;Microsoft YaHei&quot;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;">　　（一）协议各方主体：</p><p style="margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; color: rgb(0, 0, 0); font-family: &quot;Microsoft YaHei&quot;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;">　　甲方（受让方）：昆药集团医药商业有限公司</p><p style="margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; color: rgb(0, 0, 0); font-family: &quot;Microsoft YaHei&quot;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;">　　乙方（转让方）：曲靖市康桥医药有限责任公司的全体股东（乙方一：蒋建飞；乙方二：胡强；乙方三：田建东；乙方四：陈德仲；乙方五：徐树升；乙方六：郭兰芳；乙方七：韩丽）</p><p style="margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; color: rgb(0, 0, 0); font-family: &quot;Microsoft YaHei&quot;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;">　　丙方（目标公司）：曲靖市康桥医药有限责任公司</p><p style="margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; color: rgb(0, 0, 0); font-family: &quot;Microsoft YaHei&quot;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;">　　（二）本次交易目标</p><p style="margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; color: rgb(0, 0, 0); font-family: &quot;Microsoft YaHei&quot;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;">　　通过甲方受让乙方所持有的目标公司60%的股权，使甲方成为目标公司的股东并持有目标公司60％的股权。股权交割完成当日，各方向目标公司增资，其中甲方增加注册资本人民币600万元，增资后甲方占目标公司60%的股权，乙方增资人民币495万元，其中增加注册资本人民币400万元，人民币95万元作为目标公司的资本公积金，增资后乙方占目标公司40%的股权，使目标公司注册资本增加至人民币1，120万元。</p><p style="margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; color: rgb(0, 0, 0); font-family: &quot;Microsoft YaHei&quot;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;">　　（三）交易价格</p><p style="margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; color: rgb(0, 0, 0); font-family: &quot;Microsoft YaHei&quot;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;">　　各方确认，本次股权转让的股权转让款共计人民币2，700万元（大写：贰仟柒佰万元整）。本协议生效后，除甲乙双方另有书面约定外，任何一方不得以任何理由调减或增加转让价格。甲方需向各转让方支付的股权转让价款具体如下：</p><p style="margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; color: rgb(0, 0, 0); font-family: &quot;Microsoft YaHei&quot;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;">　　■</p><p style="margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; color: rgb(0, 0, 0); font-family: &quot;Microsoft YaHei&quot;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;">　　（四）股权转让价款的支付</p><p style="margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; color: rgb(0, 0, 0); font-family: &quot;Microsoft YaHei&quot;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;">　　1.以上股权转让价款分两期支付，其中，第一期支付股权转让款总额的50%，即人民币13，500，000元，第二期支付股权转让款总额的50%，即人民币13，500，000元，每期应支付给各转让方的股权转让款按照各转让方持有的目标公司股权比例分别计算。</p><p style="margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; color: rgb(0, 0, 0); font-family: &quot;Microsoft YaHei&quot;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;">　　2.各期的支付时间及条件如下：</p><p style="margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; color: rgb(0, 0, 0); font-family: &quot;Microsoft YaHei&quot;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;">　　（1）第一期股权转让款的支付条件及时间</p><p style="margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; color: rgb(0, 0, 0); font-family: &quot;Microsoft YaHei&quot;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;">　　甲方应当在下列付款条件全部成就后5个工作日内向乙方支付第一期股权转让款：</p><p style="margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; color: rgb(0, 0, 0); font-family: &quot;Microsoft YaHei&quot;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;">　　①目标公司已经召开股东会，全体股东同意本协议约定的交易目标，即“甲方通过受让乙方所持目标公司的60%的股权成为目标公司股东，甲方享有股东的权利并承担股东的义务”；全体股东均同意乙方向甲方转让股权和签署本协议；全体股东均同意放弃优先购买权。同时，目标公司已经将该股东会决议和各股东放弃优先购买权的书面文件提供给了甲方。</p><p style="margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; color: rgb(0, 0, 0); font-family: &quot;Microsoft YaHei&quot;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;">　　②目标公司已按照甲乙丙三方签署的《股权收购框架协议》及甲方的要求完成业务分立，并得到甲方的确认。</p><p style="margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; color: rgb(0, 0, 0); font-family: &quot;Microsoft YaHei&quot;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;">　　③本协议已经协议各方正式签署并生效。</p><p style="margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; color: rgb(0, 0, 0); font-family: &quot;Microsoft YaHei&quot;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;">　　（2）第二期股权转让价款的支付条件及时间</p><p style="margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; color: rgb(0, 0, 0); font-family: &quot;Microsoft YaHei&quot;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;">　　甲方应当在下列付款条件全部成就后5个工作日内向乙方支付第二期股权转让价款：</p><p style="margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; color: rgb(0, 0, 0); font-family: &quot;Microsoft YaHei&quot;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;">　　本协议第十条约定的事项已经全部办理完毕，甲方成为目标公司股东，合法持有目标公司60%的股权，享有股东权利承担股东义务。</p><p style="margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; color: rgb(0, 0, 0); font-family: &quot;Microsoft YaHei&quot;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;">　　（五）本次股权转让涉及的交易标的交割</p><p style="margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; color: rgb(0, 0, 0); font-family: &quot;Microsoft YaHei&quot;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;">　　1．各方协商确定，以本次股权转让涉及的交易标的即目标公司60%的股权全部记载于目标公司股东名册甲方名下并完成工商变更登记之日为股权交割日。</p><p style="margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; color: rgb(0, 0, 0); font-family: &quot;Microsoft YaHei&quot;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;">　　2.本次股权转让涉及的交易标的交割前，乙方应向甲方提交康桥医药零售板块业务的分立情况的相关资料，乙方应将目标公司的资产盘点造册后交由甲方确认，同时乙方应向甲方提交目标公司资产的权属证明或其他能够证明或确认产权权属属于目标公司的文件。</p><p style="margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; color: rgb(0, 0, 0); font-family: &quot;Microsoft YaHei&quot;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;">　　3.乙方应在本次股权转让涉及的交易标的交割前，向甲方提交交付与本次股权转让涉及的交易标的相关的一切权利凭证和资料文件。</p><p style="margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; color: rgb(0, 0, 0); font-family: &quot;Microsoft YaHei&quot;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;">　　4.已分立的原康桥医药零售板块因经营业务或企业管理活动需要使用交割日前的相关资料时，甲方有义务予以配合或协助。</p><p style="margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; color: rgb(0, 0, 0); font-family: &quot;Microsoft YaHei&quot;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;">　　5.已分立的原康桥医药零售板块有权继续使用“康桥医药”字号，但企业名称应以增加前缀或后缀的方式与目标公司的字号有所区别。</p><p style="margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; color: rgb(0, 0, 0); font-family: &quot;Microsoft YaHei&quot;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;">　　6.鉴于目标公司作为独立法人的身份不会因本次交易而发生变化，因此，本次交易完成后目标公司应继续履行与目标公司员工（除双方确认剥离至康桥医药零售板块的员工外）的劳动合同。</p><p style="margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; color: rgb(0, 0, 0); font-family: &quot;Microsoft YaHei&quot;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;">　　7.自股权交割日起，甲方即成为持有目标公司60%股权的合法股东，合法享有股东权利并承担股东义务。</p><p style="margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; color: rgb(0, 0, 0); font-family: &quot;Microsoft YaHei&quot;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;">　　8.自股权交割日起，甲方有权根据本协议的安排，向目标公司委派相关人员正式开始工作，乙方及目标公司应配合甲方及甲方委派的人员。</p><p style="margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; color: rgb(0, 0, 0); font-family: &quot;Microsoft YaHei&quot;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;">　　9.甲乙双方同意在本协议生效并且乙方收到第一期股权转让款之日起五日内积极配合目标公司办理相应的工商变更登记手续，并于五个工作日内完成，工商变更登记手续完成且甲方被记载于目标公司股东名册时即视为股权交割完成。</p><p style="margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; color: rgb(0, 0, 0); font-family: &quot;Microsoft YaHei&quot;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;">　　（六）增资事项</p><p style="margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; color: rgb(0, 0, 0); font-family: &quot;Microsoft YaHei&quot;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;">　　股权交割后三个工作日内，各方向目标公司增资，其中甲方增加注册资本人民币600万元（大写：人民币陆佰万元整），占目标公司60%的股权，乙方增资人民币495万元（大写：人民币肆佰玖拾伍万元整），其中增加注册资本人民币400万元（大写：人民币肆佰万元整），人民币95万（大写：人民币玖拾伍万元整）作为目标公司的资本公积，乙方占目标公司40%的股权，使目标公司注册资本增加至人民币1，120万元（大写：人民币壹仟壹佰贰拾万元整）。各方的增资款应在完成此次增资的工商登记备案事项之日起三个工作日内一次性缴足。增资完成后，目标公司股权结构：</p><p style="margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; color: rgb(0, 0, 0); font-family: &quot;Microsoft YaHei&quot;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;">　　■</p><p style="margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; color: rgb(0, 0, 0); font-family: &quot;Microsoft YaHei&quot;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;">　　（七）交易完成后目标公司的运作</p><p style="margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; color: rgb(0, 0, 0); font-family: &quot;Microsoft YaHei&quot;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;">　　1.各方同意，本协议生效后，甲方可以对目标公司内部管理结构进行相应调整；目标公司的管理权限参照甲方的授权标准执行（该授权标准应于交割日前向乙方提供）。</p><p style="margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; color: rgb(0, 0, 0); font-family: &quot;Microsoft YaHei&quot;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;">　　2.股权交割日后，甲方可以按照相关规定，根据实际情况对目标公司业务经营管理模式进行具体的整合或调整。</p><p style="margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; color: rgb(0, 0, 0); font-family: &quot;Microsoft YaHei&quot;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;">　　3.股权交割日后，目标公司设立董事会、监事会，董事会由五名董事组成，由甲方推荐3名董事（包括董事长），乙方推荐2名董事，由股东会选举产生，董事每届任期为三年，任期届满，经股东会选举可连任，各董事按照一人一票的原则行使表决权；监事会由三名监事组成，由甲方、乙方各推荐1名监事，由股东会选举产生，职工监事1名，由目标公司职工代表大会选举产生，监事会主席由乙方推荐，监事每届任期为三年，任期届满，经股东会选举或者职工代表大会选举可连任，各监事按照一人一票的原则行使表决权。</p><p style="margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; color: rgb(0, 0, 0); font-family: &quot;Microsoft YaHei&quot;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;">　　4.经营管理层由总经理、副总经理、财务总监、质量总监等高级管理人员组成。其中，财务总监由甲方委派，总经理由乙方推荐，由董事会聘任。其余高级管理人员根据实际需要设定，由董事会聘任。</p><p style="margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; color: rgb(0, 0, 0); font-family: &quot;Microsoft YaHei&quot;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;">　　5.在此次股权转让及增资工商登记备案的目标公司章程中应约定，目标公司每年现金分红比例不低于当年可分配利润的30%。</p><p style="margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; color: rgb(0, 0, 0); font-family: &quot;Microsoft YaHei&quot;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;">　　6.股权交割日后，同等条件下，各转让方之间相互享有股权的特别优先受让权。</p><p style="margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; color: rgb(0, 0, 0); font-family: &quot;Microsoft YaHei&quot;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;">　　（八）特别事项</p><p style="margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; color: rgb(0, 0, 0); font-family: &quot;Microsoft YaHei&quot;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;">　　1.业绩补偿</p><p style="margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; color: rgb(0, 0, 0); font-family: &quot;Microsoft YaHei&quot;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;">　　（1）乙方对甲方的业绩承诺与补偿期间为2016年、2017 年和2018年。</p><p style="margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; color: rgb(0, 0, 0); font-family: &quot;Microsoft YaHei&quot;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;">　　（2）乙方承诺目标公司在 2016年、2017 年和2018年扣除非经常性损益后的净利润指标分别为不低于450万元、537.5万元、595.13万元，三年累计实际实现净利润不低于1，582.63万元。</p><p style="margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; color: rgb(0, 0, 0); font-family: &quot;Microsoft YaHei&quot;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;">　　（3）乙方和甲方同意，如目标公司未达到前款所承诺的净利润，即在2016年度、2017 年度和2018年度的盈利补偿期间内，累计三年的实际净利润数少于三年累计承诺净利润数的，乙方应在2018年度的审计报告出具后五个工作日内，以现金方式补偿甲方，如乙方未按时足额补偿，甲方可在期限届满之日起按同期银行贷款利率收取资金占用费，补偿金额可在乙方应得的目标公司分红中直接扣收或者要求乙方以其持有的目标公司的股权、拥有的其他合法财产作价用以补足前述差额。在业绩承诺与补偿期间，乙方所持有的目标公司的股权未经甲方书面同意，不得转让、质押或设定其他权利限制。补偿金额按照如下公式计算：</p><p style="margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; color: rgb(0, 0, 0); font-family: &quot;Microsoft YaHei&quot;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;">　　业绩补偿金额＝（1，582.63万元－扣除非经常性损益后的三年累计实际净利润数）÷ 3 ×10 × 60%</p><p style="margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; color: rgb(0, 0, 0); font-family: &quot;Microsoft YaHei&quot;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;">　　乙方各股东对以上业绩承诺及补偿承担连带责任。</p><p style="margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; color: rgb(0, 0, 0); font-family: &quot;Microsoft YaHei&quot;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;">　　（4）甲方享有自2016年1月1日起至股权交割日期间目标公司60%的股权对应的利润及收益分配权。</p><p style="margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; color: rgb(0, 0, 0); font-family: &quot;Microsoft YaHei&quot;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;">　　2、出资完整性</p><p style="margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; color: rgb(0, 0, 0); font-family: &quot;Microsoft YaHei&quot;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;">　　根据甲乙丙三方于2016年8月2日签署的《股权收购框架协议》（二）第七条第4款的约定：截止2016年12月31日经审计，扣除甲乙双方增资扩股1，000万元及2016年度净利润后的净资产账面值不得低于180万元（即分离前的注册资本180万），若差额为负，乙方须在标的公司股东大会审议通过2016年财务决算报告后10个工作日以增资方式支付给标的公司，计入资本公积金。</p><p style="margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; color: rgb(0, 0, 0); font-family: &quot;Microsoft YaHei&quot;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;">　　（九）协议生效与终止</p><p style="margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; color: rgb(0, 0, 0); font-family: &quot;Microsoft YaHei&quot;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;">　　1．本协议自同时具备以下条件时生效：</p><p style="margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; color: rgb(0, 0, 0); font-family: &quot;Microsoft YaHei&quot;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;">　　（1）甲乙丙三方签字并加盖公章；</p><p style="margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; color: rgb(0, 0, 0); font-family: &quot;Microsoft YaHei&quot;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;">　　（2）经甲方董事会及目标公司股东会审议通过本事项；</p><p style="margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; color: rgb(0, 0, 0); font-family: &quot;Microsoft YaHei&quot;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;">　　（3）该事项经甲方主管机关或有关部门批准或备案。</p><p style="margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; color: rgb(0, 0, 0); font-family: &quot;Microsoft YaHei&quot;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;">　　2.本协议的终止</p><p style="margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; color: rgb(0, 0, 0); font-family: &quot;Microsoft YaHei&quot;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;">　　（1）任何一方严重违反本协议中的相关约定，且经其他方同意弥补后仍未能及时或充分弥补的；</p><p style="margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; color: rgb(0, 0, 0); font-family: &quot;Microsoft YaHei&quot;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;">　　（2）各方协商一致解除本协议，但解除之前，各方应就后续事项达成一致意见；</p><p style="margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; color: rgb(0, 0, 0); font-family: &quot;Microsoft YaHei&quot;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;">　　（3）本协议生效后三十日内，交易标的仍未完成交割。</p><p style="margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; color: rgb(0, 0, 0); font-family: &quot;Microsoft YaHei&quot;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;">　　（4）因不可抗力或政策、法规调整的原因。</p><p style="margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; color: rgb(0, 0, 0); font-family: &quot;Microsoft YaHei&quot;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;">　　（十）违约责任</p><p style="margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; color: rgb(0, 0, 0); font-family: &quot;Microsoft YaHei&quot;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;">　　协议各方应严格遵守本协议有关约定，诚实履行有关义务。若因一方不履行或者不当履行其应履行义务而违约的，应向另一方承担违约责任，连带赔偿另一方因其不履行或者不当履行而遭受的损失，包括但不限于直接损失、诉讼费、律师费、保全费、鉴定费调查取证费、差旅费等合理费用。</p><p style="margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; color: rgb(0, 0, 0); font-family: &quot;Microsoft YaHei&quot;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;">　　任何一方未履行本协议，除承担连带赔偿责任外，还应向另一方支付本次股权转让价款5%的违约金</p><p style="margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; color: rgb(0, 0, 0); font-family: &quot;Microsoft YaHei&quot;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;">　　任何一方违约时，另一方有权要求违约方继续履行本协议。</p><p style="margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; color: rgb(0, 0, 0); font-family: &quot;Microsoft YaHei&quot;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;">　　五、涉及收购资产的其他安排</p><p style="margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; color: rgb(0, 0, 0); font-family: &quot;Microsoft YaHei&quot;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;">　　收购资产所涉曲靖康桥董、监事会及经营管理层人员安排如合同条款约定，交易完成后，可能产生因开展医药商业业务出现的包括代理销售关联方产品等日常关联交易，暂未发现因本次收购资产事项产生的其他关联交易事项及同业竞争事项。收购资产的资金来源为公司自有资金。</p><p style="margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; color: rgb(0, 0, 0); font-family: &quot;Microsoft YaHei&quot;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;">　　六、交易的目的和对公司的影响</p><p style="margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; color: rgb(0, 0, 0); font-family: &quot;Microsoft YaHei&quot;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;">　　曲靖康桥在曲靖地区有较好的市场网络，基层配送区域覆盖较为全面，配送区域数量在曲靖地区排名第二位，对其进行股权投资符合昆药商业深根云南、做透终端发展战略。曲靖康桥具备良好的发展机会和较高的成长性，可结合昆药商业在资金和产品上的优势，充分发挥曲靖康桥良好的市场网络资源，快速扩大、做深市场网络，使昆药商业在曲靖市场的终端形成布局，提高昆药商业的自身价值。</p><p style="margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; color: rgb(0, 0, 0); font-family: &quot;Microsoft YaHei&quot;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;">　　本收购事项完成后，公司将成为曲靖康桥控股股东，将增加合并报表范围，可一定程度上扩大公司的收入、利润规模。</p><p style="margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; color: rgb(0, 0, 0); font-family: &quot;Microsoft YaHei&quot;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;">　　七、交易事项的风险分析</p><p style="margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; color: rgb(0, 0, 0); font-family: &quot;Microsoft YaHei&quot;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;">　　本次收购具有因药价改革、医保控费和地方药品招标政策变化而导致预计收益难以达成的风险，公司已在交易协议中与交易对方约定未来三年的业绩补偿，且公司将加强对宏观经济和行业政策的分析研究，顺应国家医改政策新环境，强化政府事务工作，减轻行业政策变化风险带来的影响。</p><p style="margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; color: rgb(0, 0, 0); font-family: &quot;Microsoft YaHei&quot;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;">　　请广大投资者理性投资，注意投资风险。</p><p style="margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; color: rgb(0, 0, 0); font-family: &quot;Microsoft YaHei&quot;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;">　　八、上网公告附件</p><p style="margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; color: rgb(0, 0, 0); font-family: &quot;Microsoft YaHei&quot;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;">　　（一）昆药集团董事会关于昆药集团医药商业有限公司收购曲靖市康桥医药有限责任公司60%股权评估相关事宜的审核意见</p><p style="margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; color: rgb(0, 0, 0); font-family: &quot;Microsoft YaHei&quot;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;">　　（二）昆药集团独立董事关于昆药集团医药商业有限公司收购曲靖市康桥医药有限责任公司60%股权评估相关事宜的独立意见</p><p style="margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; color: rgb(0, 0, 0); font-family: &quot;Microsoft YaHei&quot;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;">　　（三）审计报告（含财务报表）</p><p style="margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; color: rgb(0, 0, 0); font-family: &quot;Microsoft YaHei&quot;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;">　　（四）评估报告</p><p style="margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; color: rgb(0, 0, 0); font-family: &quot;Microsoft YaHei&quot;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;">　　特此公告。</p><p style="margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; color: rgb(0, 0, 0); font-family: &quot;Microsoft YaHei&quot;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;">　　昆药集团股份有限公司董事会</p><p style="margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; color: rgb(0, 0, 0); font-family: &quot;Microsoft YaHei&quot;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;">　　2016年11月28日</p><p style="margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; color: rgb(0, 0, 0); font-family: &quot;Microsoft YaHei&quot;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;">　　证券代码：600422 证券简称：昆药集团公告编号：临2016-101号</p><p style="margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; color: rgb(0, 0, 0); font-family: &quot;Microsoft YaHei&quot;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;">　　昆药集团股份有限公司关于投资华</p><p style="margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; color: rgb(0, 0, 0); font-family: &quot;Microsoft YaHei&quot;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;">　　盖信诚医疗健康投资成都合伙企业</p><p style="margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; color: rgb(0, 0, 0); font-family: &quot;Microsoft YaHei&quot;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;">　　（有限合伙）的公告</p><p style="margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; color: rgb(0, 0, 0); font-family: &quot;Microsoft YaHei&quot;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;">　　本公司董事会及全体董事保证本公告内容不存在任何虚假记载、误导性陈述或者重大遗漏，并对其内容的真实性、准确性和完整性承担个别及连带责任。</p><p style="margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; color: rgb(0, 0, 0); font-family: &quot;Microsoft YaHei&quot;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;">　　公司拟以自有资金投资2，000万元人民币作为有限合伙人参与认购华盖信诚医疗健康投资成都合伙企业（有限合伙）（以下简称“华盖二期基金”）。本议案于2016年11月24日公司八届二十二次董事会审议通过，具体情况如下：</p><p style="margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; color: rgb(0, 0, 0); font-family: &quot;Microsoft YaHei&quot;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;">　　一、华盖二期基金的普通合伙人情况</p><p style="margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; color: rgb(0, 0, 0); font-family: &quot;Microsoft YaHei&quot;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;">　　企业名称:华盖医疗投资管理(北京)有限公司?</p><p style="margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; color: rgb(0, 0, 0); font-family: &quot;Microsoft YaHei&quot;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;">　　类型:其他有限责任公司</p><p style="margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; color: rgb(0, 0, 0); font-family: &quot;Microsoft YaHei&quot;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;">　　住所:北京市丰台区丽泽路18号院1号楼701-08室</p><p style="margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; color: rgb(0, 0, 0); font-family: &quot;Microsoft YaHei&quot;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;">　　法定代表人:许小林?</p><p style="margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; color: rgb(0, 0, 0); font-family: &quot;Microsoft YaHei&quot;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;">　　注册资本:1，000万元</p><p style="margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; color: rgb(0, 0, 0); font-family: &quot;Microsoft YaHei&quot;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;">　　成立日期:2013年12月19日</p><p style="margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; color: rgb(0, 0, 0); font-family: &quot;Microsoft YaHei&quot;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;">　　经营范围:资产管理，投资管理，财务管理(不得开展审计、验资、查账、评估、会计咨询、代理记账等须经专项审批的业务；不得出具相应的审计报告、验资报告、查账报告、评估报告等文字资料)；投资咨询；企业管理咨询。</p><p style="margin-top: 15px; margin-bottom: 15px; padding: 0px; line-height: 2em; color: rgb(0, 0, 0); font-family: &quot;Microsoft YaHei&quot;, u5FAEu8F6Fu96C5u9ED1, Arial, SimSun, u5B8Bu4F53; white-space: normal;">　　华盖信诚医疗健康投资成都合伙企业（有限合伙）是华盖医疗投资管理（北京）有限公司旗下管理的基金之一，从事专业的股权投资管理业务，管理团队由海内外知名的海归企业家以及风险投资专家组成，拥有资深的专业背景和丰富的医疗健康领域投资经验，主要管理人员：许小林、曾志强、鹿炳辉、丰雷（拟设基金投委会成员），目前管理1支基金，规模4.15亿元。主要投资领域：医疗器械、医疗服务、生物医药。根据北京英特纳尔仲德会计师事务所出具京仲审字[2016]第037号审计报告，华盖医疗投资管理(北京)有限公司2015年末总资产315.97万元、净资产99.85万元，2015年度实现营业收入539.29万元，净利润-42.55万元。华盖医疗投资管理(北京)有限公司已在基金业协会备案，登记编号：P1002607。</p><p><br/></p>', '2016-11-28 16:25:11', 1, 0, '昆药集团股份有限公司公告（系列）', 0, '402881f9589a81ba01589a86ae9e0001', '0', '402880e428abfce20128ac0040c20001', '/upload/article/402880e428abfce20128ac0040c200011480321510852.jpg', '');
