('402881e858aa060a0158aa0fa4660005', '今日亨通光电公告被增持445万股今日亨通光电公告被增持445万股', '<p style="margin-top: 0px; margin-bottom: 20px; padding: 0px; text-indent: 2em; color: rgb(65, 65, 65); font-family: 微软雅黑; white-space: normal;">对公司股份进行增持无疑是一大利好，说明增持方对公司的长期看好，特别是大股东或者管理层的增持，因为他们最了解自己的公司。另一方面也表明股价被低估，尤其是一轮大的下跌后，市场估值低于公司的实际价值，引发了抄底行为。<br style="margin: 0px; padding: 0px;"/>　　证券时报股市大数据新媒体“数据宝”统计，今日<span id="stock_sh600487" style="margin: 0px; padding: 0px; font-weight: bold;"><a class="keyword" href="http://cy.stcn.com/S/SH600487" target="_blank" style="margin: 0px; padding: 0px; color: rgb(13, 83, 110); text-decoration: none; outline: none;">亨通光电</a></span><span id="quote_sh600487" style="margin: 0px; padding: 0px; font-weight: bold;"></span>披露被股东增持，增持股数为445.39万股，占流通A股比例为0.39%，增持市值达8408.98万元。（数据宝）<br style="margin: 0px; padding: 0px;"/><a href="http://info.stcn.com/companydata/partnerOutperform.jsp" target="_blank" style="margin: 0px; padding: 0px; color: rgb(13, 83, 110); text-decoration: none; outline: none;">点击查看更多数据</a></p><p class="txt_tit" style="margin-top: 0px; margin-bottom: 20px; padding: 0px; font-weight: bold; font-family: 微软雅黑; font-size: 18px; color: rgb(53, 68, 101); text-align: center; text-indent: 2em; white-space: normal;">今日公告股东增持数据一览</p><table class="tabstyle_20150616" border="1" cellspacing="0" style="margin-top: 0px; margin-bottom: 30px; padding: 0px; border-spacing: 0px; width: 699px; border: 1px solid rgb(224, 234, 240); text-align: center; font-family: 微软雅黑; font-size: 13px; color: rgb(65, 65, 65); white-space: normal;"><tbody style="margin: 0px; padding: 0px;"><tr class="tabhead" style="margin: 0px; padding: 0px; background: rgb(241, 249, 255);"><th style="margin: 0px; padding: 4px; border: 1px solid rgb(224, 234, 240); border-collapse: collapse; line-height: 20px;">证券代码</th><th style="margin: 0px; padding: 4px; border: 1px solid rgb(224, 234, 240); border-collapse: collapse; line-height: 20px;">证券简称</th><th style="margin: 0px; padding: 4px; border: 1p