('402881e858aa060a0158aa133b900007', '比武场与战场相关时间段分段公告', '<p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; line-height: 24px; color: rgb(88, 96, 106); font-family: 宋体; font-size: 12px; white-space: normal;"><span style="font-family: 微软雅黑, &quot;Microsoft YaHei&quot;; font-size: 14px;">亲爱的灵芝们：</span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; line-height: 24px; color: rgb(88, 96, 106); font-family: 宋体; font-size: 12px; white-space: normal;"><span style="font-family: 微软雅黑, &quot;Microsoft YaHei&quot;; font-size: 14px;">在11月24日的版本更新中，我们调整了PVP比武与战场分数获取规则，一天内只有限定时间段内才可获得收益。</span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; line-height: 24px; color: rgb(88, 96, 106); font-family: 宋体; font-size: 12px; white-space: normal;"><span style="font-family: 微软雅黑, &quot;Microsoft YaHei&quot;; font-size: 14px;">详细时间段介绍如下，请周知：</span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; line-height: 24px; color: rgb(88, 96, 106); font-family: 宋体; font-size: 12px; white-space: normal;"><span style="font-family: 微软雅黑, &quot;Microsoft YaHei&quot;; font-size: 14px;"><br/></span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; line-height: 24px; color: rgb(88, 96, 106); font-family: 宋体; font-size: 12px; white-space: normal;"><span style="font-family: 微软雅黑, &quot;Microsoft YaHei&quot;; font-size: 14px;">比武个人战、车轮战每天凌晨00：00至中午12：00为练习赛时间；</span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; line-height: 24px; color: rgb(88, 96, 106); font-family: 宋体; font-size: 12px; white-space: normal;"><span style="font-family: 微软雅黑, &quot;Microsoft YaHei&quot;; font-size: 14px;">战场每天凌晨00：00至晚上20：00为练习赛时间；<br/>练习赛期间无法获得奖励。</span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; line-height: 24px; color: rgb(88, 96, 106); font-family: 宋体; font-size: 12px; white-space: normal;"><span style="font-family: 微软雅黑, &quot;Microsoft YaHei&quot;; font-size: 14px;"><br/></span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; line-height: 24px; color: rgb(88, 96, 106); font-family: 宋体; font-size: 12px; white-space: normal;"><span style="font-family: 微软雅黑, &quot;Microsoft YaHei&quot;; font-size: 14px;">战场的热力时间为：<br/>中午12：00至下午15：00；<br/>晚上20：00至晚上23：00；</span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; line-height: 24px; color: rgb(88, 96, 106); font-family: 宋体; font-size: 12px; white-space: normal;"><span style="font-family: 微软雅黑, &quot;Microsoft YaHei&quot;; font-size: 14px;"><br/></span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; line-height: 24px; color: rgb(88, 96, 106); font-family: 宋体; font-size: 12px; white-space: normal;"><span style="font-family: 微软雅黑, &quot;Microsoft YaHei&quot;; font-size: 14px;">比武个人赛热力时间为：<br/>周2/4/6中午12：00至凌晨24：00；</span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; line-height: 24px; color: rgb(88, 96, 106); font-family: 宋体; font-size: 12px; white-space: normal;"><span style="font-family: 微软雅黑, &quot;Microsoft YaHei&quot;; font-size: 14px;"><br/></span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; line-height: 24px; color: rgb(88, 96, 106); font-family: 宋体; font-size: 12px; white-space: normal;"><span style="font-family: 微软雅黑, &quot;Microsoft YaHei&quot;; font-size: 14px;">比武车轮战热力时间为<br/>周1/3/5/7中午12：00至凌晨24：00；</span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; line-height: 24px; color: rgb(88, 96, 106); font-family: 宋体; font-size: 12px; white-space: normal;"><span style="font-family: 微软雅黑, &quot;Microsoft YaHei&quot;; font-size: 14px;"><br/></span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; line-height: 24px; color: rgb(88, 96, 106); font-family: 宋体; font-size: 12px; white-space: normal;"><span style="font-family: 微软雅黑, &quot;Microsoft YaHei&quot;; font-size: 14px;">热力时间段内有额外的比武每日任务和奖励；</span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; line-height: 24px; color: rgb(88, 96, 106); font-family: 宋体; font-size: 12px; white-space: normal;"><span style="font-family: 微软雅黑, &quot;Microsoft YaHei&quot;; font-size: 14px;"><br/></span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; line-height: 24px; color: rgb(88, 96, 106); font-family: 宋体; font-size: 12px; white-space: normal;"><span style="font-family: 微软雅黑, &quot;Microsoft YaHei&quot;; font-size: 14px;">以上，特此公告</span></p><p><br/></p>', '2016-11-28 16:35:36', 0, 0, '比武场与战场相关时间段分段公告', 0, '402881f9589a81ba01589a86ae9e0001', '0', '402880e428abfce20128ac0040c20001', '/upload/article/402880e428abfce20128ac0040c200011480322130911.jpg', ''),
('402881e858aa060a0158aa13a5df0008', '狂欢必读：3周年版本部分内容调整公告', '<p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; line-height: 24px; color: rgb(88, 96, 106); font-family: 宋体; font-size: 12px; white-space: normal;"><span style="font-family: 微软雅黑, &quot;Microsoft YaHei&quot;; font-size: 14px;">亲爱的灵芝们：</span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; line-height: 24px; color: rgb(88, 96, 106); font-family: 宋体; font-size: 12px; white-space: normal;"><span style="font-family: 微软雅黑, &quot;Microsoft YaHei&quot;; font-size: 14px;">3周年版本更新在即，小伙伴们准备好迎接生日狂欢了么?</span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; line-height: 24px; color: rgb(88, 96, 106); font-family: 宋体; font-size: 12px; white-space: normal;"><span style="font-family: 微软雅黑, &quot;Microsoft YaHei&quot;; font-size: 14px;">在一系列系统优化的同时，游戏内部分内容也将进行调整，请小伙伴们提前做好准备：</span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; line-height: 24px; color: rgb(88, 96, 106); font-family: 宋体; font-size: 12px; white-space: normal;"><span style="font-family: 微软雅黑, &quot;Microsoft YaHei&quot;; font-size: 14px;"><br/></span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; line-height: 24px; color: rgb(88, 96, 106); font-family: 宋体; font-size: 12px; white-space: normal;"><span style="font-family: 微软雅黑, &quot;Microsoft YaHei&quot;; font-size: 14px;">【守护石系统调整】</span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; line-height: 24px; color: rgb(88, 96, 106); font-family: 宋体; font-size: 12px; white-space: normal;"><span style="font-family: 微软雅黑, &quot;Microsoft YaHei&quot;; font-size: 14px;">守护石系统更新：更新后，现有守护石可分解为守护石（不带外观只有属性）和幻影石（只有外观没有属性），幻影石可以像幻影武器一样，给守护石幻化外形。同时，我们将开放不带外观只有属性的守护石在同账号下角色间的交易</span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; line-height: 24px; color: rgb(88, 96, 106); font-family: 宋体; font-size: 12px; white-space: normal;"><span style="font-family: 微软雅黑, &quot;Microsoft YaHei&quot;; font-size: 14px;"><br/></span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; line-height: 24px; color: rgb(88, 96, 106); font-family: 宋体; font-size: 12px; white-space: normal;"><span style="font-family: 微软雅黑, &quot;Microsoft YaHei&quot;; font-size: 14px;">【角色成长调整】</span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; line-height: 24px; color: rgb(88, 96, 106); font-family: 宋体; font-size: 12px; white-space: normal;"><span style="font-family: 微软雅黑, &quot;Microsoft YaHei&quot;; font-size: 14px;">1.双倍活力值设定去除：周年庆版本更新后，双倍活力值系统将会去除，玩家将不会再获得双倍活力值，且存储的双倍活力会被清空，请玩家尽量提前使用完双倍活力。</span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; line-height: 24px; color: rgb(88, 96, 106); font-family: 宋体; font-size: 12px; white-space: normal;"><span style="font-family: 微软雅黑, &quot;Microsoft YaHei&quot;; font-size: 14px;">2.主线任务经验大幅提升：周年庆版本中，所有主线任务经验将会大幅提升，在即将到来的后续版本中，我们还会对主线任务进行进一步的优化，完善整个升级体验</span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; line-height: 24px; color: rgb(88, 96, 106); font-family: 宋体; font-size: 12px; white-space: normal;"><span style="font-family: 微软雅黑, &quot;Microsoft YaHei&quot;; font-size: 14px;"><br/></span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; line-height: 24px; color: rgb(88, 96, 106); font-family: 宋体; font-size: 12px; white-space: normal;"><span style="font-family: 微软雅黑, &quot;Microsoft YaHei&quot;; font-size: 14px;">【新一期势力优化相关调整】</span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; line-height: 24px; color: rgb(88, 96, 106); font-family: 宋体; font-size: 12px; white-space: normal;"><span style="font-family: 微软雅黑, &quot;Microsoft YaHei&quot;; font-size: 14px;">第三期势力优化即将开始，本次势力优化着力于同大区不同服务器之间的势力优化，我们将进行以下调整：</span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; line-height: 24px; color: rgb(88, 96, 106); font-family: 宋体; font-size: 12px; white-space: normal;"><span style="font-family: 微软雅黑, &quot;Microsoft YaHei&quot;; font-size: 14px;">1.丰汇行上架时间限定：为了更好地保证势力优化的数据完整性，我们将会在势力优化前6个小时关闭丰汇行（不关闭拍卖行），为此，周年庆版本中，我们将会将丰汇行上架时间限定为6小时</span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; line-height: 24px; color: rgb(88, 96, 106); font-family: 宋体; font-size: 12px; white-space: normal;"><span style="font-family: 微软雅黑, &quot;Microsoft YaHei&quot;; font-size: 14px;">2.新赛季实际开始时间调整：合服后，比武赛季分数以及排行榜数据将会被清空，原定11月24日更新的新赛季，实际开始时间为势力优化完成后开始。</span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; line-height: 24px; color: rgb(88, 96, 106); font-family: 宋体; font-size: 12px; white-space: normal;"><span style="font-family: 微软雅黑, &quot;Microsoft YaHei&quot;; font-size: 14px;"><br/></span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; line-height: 24px; color: rgb(88, 96, 106); font-family: 宋体; font-size: 12px; white-space: normal;"><span style="font-family: 微软雅黑, &quot;Microsoft YaHei&quot;; font-size: 14px;">【苍穹盆地调整】</span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; line-height: 24px; color: rgb(88, 96, 106); font-family: 宋体; font-size: 12px; white-space: normal;"><span style="font-family: 微软雅黑, &quot;Microsoft YaHei&quot;; font-size: 14px;">1.苍穹盆地任务重置：在周年庆版本更新后，未完成的苍穹盆地任务会被重置，请小伙伴们提前完成任务，避免不必要的损失</span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; line-height: 24px; color: rgb(88, 96, 106); font-family: 宋体; font-size: 12px; white-space: normal;"><span style="font-family: 微软雅黑, &quot;Microsoft YaHei&quot;; font-size: 14px;">2.苍穹盆地奖励上调：新增星云首饰成长所需的祭品首饰兑换，并上调任务奖励，整体上仙桃的获取效率提升约60%</span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; line-height: 24px; color: rgb(88, 96, 106); font-family: 宋体; font-size: 12px; white-space: normal;"><span style="font-family: 微软雅黑, &quot;Microsoft YaHei&quot;; font-size: 14px;"><br/></span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; line-height: 24px; color: rgb(88, 96, 106); font-family: 宋体; font-size: 12px; white-space: normal;"><span style="font-family: 微软雅黑, &quot;Microsoft YaHei&quot;; font-size: 14px;">【星云装备调整】</span><br/></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; line-height: 24px; color: rgb(88, 96, 106); font-family: 宋体; font-size: 12px; white-space: normal;"><span style="font-family: 微软雅黑, &quot;Microsoft YaHei&quot;; font-size: 14px;">1.星云首饰成长调整：星云首饰8段不再用于烛魔首饰1段直升4段，星云首饰12段用于烛魔首饰直升8段的费用增加；</span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; line-height: 24px; color: rgb(88, 96, 106); font-family: 宋体; font-size: 12px; white-space: normal;"><span style="font-family: 微软雅黑, &quot;Microsoft YaHei&quot;; font-size: 14px;">2.传说哥NPC处祝福S2兑换星云武器10段的条目去除，替换为可以兑换烛魔武器4段；</span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; line-height: 24px; color: rgb(88, 96, 106); font-family: 宋体; font-size: 12px; white-space: normal;"><span style="font-family: 微软雅黑, &quot;Microsoft YaHei&quot;; font-size: 14px;"><br/></span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; line-height: 24px; color: rgb(88, 96, 106); font-family: 宋体; font-size: 12px; white-space: normal;"><span style="font-family: 微软雅黑, &quot;Microsoft YaHei&quot;; font-size: 14px;">【NPC兑换关系调整】</span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; line-height: 24px; color: rgb(88, 96, 106); font-family: 宋体; font-size: 12px; white-space: normal;"><span style="font-family: 微软雅黑, &quot;Microsoft YaHei&quot;; font-size: 14px;">1.去除传说哥NPC处白青灵核的变更属性流程，可直接用南天国成长代币换1段，可在灵核的成长中调整属性。</span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; line-height: 24px; color: rgb(88, 96, 106); font-family: 宋体; font-size: 12px; white-space: normal;"><span style="font-family: 微软雅黑, &quot;Microsoft YaHei&quot;; font-size: 14px;">2.去除传说哥NPC处星云首饰调整自然属性兑换，可在提炼中调整自然属性（参考烛魔首饰）</span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; line-height: 24px; color: rgb(88, 96, 106); font-family: 宋体; font-size: 12px; white-space: normal;"><span style="font-family: 微软雅黑, &quot;Microsoft YaHei&quot;; font-size: 14px;">3.去除仙豆兑换员/黑枪族部落乔韩雪NPC处用修炼凭证/浊气珠兑换星云首饰1段的兑换关系</span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; line-height: 24px; color: rgb(88, 96, 106); font-family: 宋体; font-size: 12px; white-space: normal;"><span style="font-family: 微软雅黑, &quot;Microsoft YaHei&quot;; font-size: 14px;">4.降低仙豆兑换NPC处暴风武器购买费用（4个高级白青进化石变更为4个白青进化石）</span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; line-height: 24px; color: rgb(88, 96, 106); font-family: 宋体; font-size: 12px; white-space: normal;"><span style="font-family: 微软雅黑, &quot;Microsoft YaHei&quot;; font-size: 14px;">5.替换钱树里NPC处 兑换星云首饰1段所需的白青传说碎片为南天国成长代币；</span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; line-height: 24px; color: rgb(88, 96, 106); font-family: 宋体; font-size: 12px; white-space: normal;"><span style="font-family: 微软雅黑, &quot;Microsoft YaHei&quot;; font-size: 14px;"><br/></span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; line-height: 24px; color: rgb(88, 96, 106); font-family: 宋体; font-size: 12px; white-space: normal;"><span style="font-family: 微软雅黑, &quot;Microsoft YaHei&quot;; font-size: 14px;">【七角彩虹石调整】</span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; line-height: 24px; color: rgb(88, 96, 106); font-family: 宋体; font-size: 12px; white-space: normal;"><span style="font-family: 微软雅黑, &quot;Microsoft YaHei&quot;; font-size: 14px;">新增不可交易的七角彩虹石袋，原可交易的七角彩虹石仍然可以交易，但游戏内不再产出。</span></p><p><br/></p>', '2016-11-28 16:36:04', 1, 0, '狂欢必读：3周年版本部分内容调整公告', 0, '402881f9589a81ba01589a86ae9e0001', '0', '402880e428abfce20128ac0040c20001', '/upload/article/402880e428abfce20128ac0040c200011480322162939.jpg', '');
INSERT INTO `sys_article` (`id`, `artAbstract`, `content`, `publishTime`, `readCount`, `supportCount`, `title`, `unSupportCount`, `category_id`, `publish_org_id`, `publishAuthor_id`, `imgUrl`, `tag`) VALUES
('402881e858aa060a0158aa143ed70009', '双11福利派送！以爱之名，温暖单身的你！', '<p></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; line-height: 24px; color: rgb(88, 96, 106); font-family: 宋体; font-size: 12px; white-space: normal;"><span style="font-family: 微软雅黑, &quot;Microsoft YaHei&quot;; font-size: 14px;">亲爱的灵芝们：</span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; line-height: 24px; color: rgb(88, 96, 106); font-family: 宋体; font-size: 12px; white-space: normal;"><span style="font-size: 14px;">随着双11的临近，风越来越冷，天越来越灰，而你是否还依然形单影只？</span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; line-height: 24px; color: rgb(88, 96, 106); font-family: 宋体; font-size: 12px; white-space: normal;"><span style="font-size: 14px;">然而，即使天寒地冻，依然还有剑灵给你温暖！双11“狗粮”福利大派送即将开启！</span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; line-height: 24px; color: rgb(88, 96, 106); font-family: 宋体; font-size: 12px; white-space: normal;"><img src="http://ossweb-img.qq.com/upload/webplat/info/bns/20161104/1478251153517589.png" title="1478251153517589.png" alt="1478251153517589.png" width="900" height="400" border="0" vspace="0" style="margin: 5px 0px; padding: 0px; border: 0px; vertical-align: top; display: block; width: 900px; height: 400px;"/></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; line-height: 24px; color: rgb(88, 96, 106); font-family: 宋体; font-size: 12px; white-space: normal;"><br/></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; line-height: 24px; color: rgb(88, 96, 106); font-family: 宋体; font-size: 12px; white-space: normal;"><span style="font-size: 14px; font-family: 微软雅黑, &quot;Microsoft YaHei&quot;;">part1.活动期间登录即领温暖礼包</span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; line-height: 24px; color: rgb(88, 96, 106); font-family: 宋体; font-size: 12px; white-space: normal;"><span style="font-size: 14px; font-family: 微软雅黑, &quot;Microsoft YaHei&quot;;">在11月10日、11日、12日三天，有登录记录的玩家即可分别领取双11温暖礼包哦~</span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; line-height: 24px; color: rgb(88, 96, 106); font-family: 宋体; font-size: 12px; white-space: normal;"><span style="font-size: 14px; font-family: 微软雅黑, &quot;Microsoft YaHei&quot;;">领取时请务必注意礼包名称和奖励内涵，感受来自官方的满满“爱意”吧~</span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; line-height: 24px; color: rgb(88, 96, 106); font-family: 宋体; font-size: 12px; white-space: normal;"><img src="http://ossweb-img.qq.com/upload/webplat/info/bns/20161104/1478251926758973.png" title="1478251926758973.png" alt="1478251926758973.png" width="900" height="801" border="0" vspace="0" style="margin: 5px 0px; padding: 0px; border: 0px; vertical-align: top; display: block; width: 900px; height: 801px;"/></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; line-height: 24px; color: rgb(88, 96, 106); font-family: 宋体; font-size: 12px; white-space: normal;"><br/></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; line-height: 24px; color: rgb(88, 96, 106); font-family: 宋体; font-size: 12px; white-space: normal;"><span style="font-size: 14px; font-family: 微软雅黑, &quot;Microsoft YaHei&quot;;">part2.非欧国籍大战</span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; line-height: 24px; color: rgb(88, 96, 106); font-family: 宋体; font-size: 12px; white-space: normal;"><span style="font-size: 14px; font-family: 微软雅黑, &quot;Microsoft YaHei&quot;;">活动期间，每日登录即可获得一次抽奖机会，你是欧气满满还是非气十足，一抽见分晓~</span></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; line-height: 24px; color: rgb(88, 96, 106); font-family: 宋体; font-size: 12px; white-space: normal;"><img src="http://ossweb-img.qq.com/upload/webplat/info/bns/20161104/1478252165182362.png" title="1478252165182362.png" alt="1478252165182362.png" width="900" height="512" border="0" vspace="0" style="margin: 5px 0px; padding: 0px; border: 0px; vertical-align: top; display: block; width: 900px; height: 512px;"/></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; line-height: 24px; color: rgb(88, 96, 106); font-family: 宋体; font-size: 12px; white-space: normal;"><br/></p><p style="margin-top: 0px; margin-bottom: 0px; padding: 0px; line-height: 24px; color: rgb(88, 96, 106); font-family: 宋体; font-size: 12px; white-space: normal;"><span style="font-family: 微软雅黑, &quot;Microsoft YaHei&quot;; font-size: 14px;">双11福利派送，千万不要错过哦~</span></p><p><strong></strong><br/></p>', '2016-11-28 16:36:43', 7, 0, '双11福利派送！以爱之名，温暖单身的你！', 0, '402881f9589a81ba01589a86ae9e0001', '0', '402880e428abfce20128ac0040c20001', '/upload/article/402880e428abfce20128ac0040c200011480322203308.jpg', ''),
('402881fd589e728701589e752fd20000', '对玩家来说，一只好的宠物就是西行路上强有力的保证。但是呢，不少新手玩家对眼花缭乱的本源技和进化技感到头疼，无从下手。所以今天这贴就是让新手玩家少走弯路。', '<p>&nbsp; &nbsp; 对玩家来说，一只好的宠物就是西行路上强有力的保证。但是呢，不少新手玩家对眼花缭乱的本源技和进化技感到头疼，无从下手。所以今天这贴就是让新手玩家少走弯路。</p><p>当然老玩家也可以一起来指导一下哈。</p><p>　　目前宠物最好的就是魔化阿玉，阿玉，当然魔化至尊宝，至尊宝也都很好，但是这些宠物土豪专属，大部分人是搞不到的，然后像魔化泥鳅和泥鳅说实话都是华而不实，所</p><p>以这里就不多说了。</p><p>　　刷图类宠物推荐：</p><p>　　1、花妖：主人周围10米内所有目标防御降低8%。</p><p>　　这个效果是常驻的，不用像虎仙那样靠脸，俗话说得好，稳定压倒一切嘛。</p><p>　　2、狮僧：每次攻击都有10%几率使伤害增加3%，持续5秒，最多3层。</p><p>　　3、虎仙：每次攻击有百分5几率使下2秒内伤害提升100%，10秒冷却。</p><p>　　这两个宠物纷争由来已久，说实话我也不知道该说哪一个宠物更好，整体比下来是差不多的。狮僧比较稳定，适合脸黑同学，而虎仙就是要他爆发那一下的酸爽。玩家自行</p><p>选择吧。</p><p><br/></p>', '2016-11-26 15:19:27', 9, 0, '神将刷图PK宠物推荐 进化技选择', 0, '402881f9589a81ba01589a86ae9e0001', '0', '402880e428abfce20128ac0040c20001', '/upload/article/402880e428abfce20128ac0040c200011480144766880.jpg', ''),
('402881fd589e728701589e75a3ac0001', '传奇经典的三大职业每个职业都有自己的特点，武士以优秀的攻击力和血量为自身的特色;法师则是优秀的远程攻击和持续伤\r\n害;道士则是召唤宝宝以及辅助技能等。', '<p>传奇经典的三大职业每个职业都有自己的特点，武士以优秀的攻击力和血量为自身的特色;法师则是优秀的远程攻击和持续伤</p><p>害;道士则是召唤宝宝以及辅助技能等。</p><p>&nbsp; &nbsp; 对于初来《龙途》地下宫殿的新人们而言，在丘伯处洗炼铭文无疑是极好的。这里可以洗出不少适合前期练级打怪的铭文。如战士攻杀剑术的煌龙印；法师诱惑之光的血契印、火墙</p><p>的观火印；道士召唤骷髅的迦兰印等</p><p><img src="http://localhost:8080/app4ml/res_admin/umeditor1_2_2/jsp/upload/20161126/15041480143461383.jpg" _src="http://localhost:8080/app4ml/res_admin/umeditor1_2_2/jsp/upload/20161126/15041480143461383.jpg"/></p><p style="white-space: normal;">对于初来《龙途》地下宫殿的新人们而言，在丘伯处洗炼铭文无疑是极好的。这里可以洗出不少适合前期练级打怪的铭文。如战士攻杀剑术的煌龙印；法师诱惑之光的血契印、火墙</p><p style="white-space: normal;">的观火印；道士召唤骷髅的迦兰印等</p><p><br/></p>', '2016-11-26 15:20:53', 3, 0, '传奇三大职业战力对比，成型后的战斗', 0, '402881f9589a81ba01589a88dcb50002', '0', '402880e428abfce20128ac0040c20001', '/upload/article/402880e428abfce20128ac0040c200011480144853739.jpg', ''),
